import React, { useEffect, useRef } from 'react';
import ApexCharts from 'apexcharts';

const ProfileReportChart = () => {
  const profileReportChartRef = useRef(null);
  let profileReportChart:any;

  useEffect(() => {
    const profileReportChartConfig = {
      chart: {
        height: 350,
        type: 'line',
        toolbar: {
          show: false
        },
        // ... other chart configuration options
      },
      series: [
        {
          name: 'Sales',
          data: [30, 40, 35, 50, 49, 60, 70, 91, 125]
        },
        // ... other series data
      ],
      xaxis: {
        categories: ['Jan', 'Feb', 'Mar', 'Apr', 'May', 'Jun', 'Jul', 'Aug', 'Sep']
      }
      // ... other options
    };

    if (profileReportChartRef.current && !profileReportChart) {
      profileReportChart = new ApexCharts(profileReportChartRef.current, profileReportChartConfig);
      profileReportChart.render();
    }

    return () => {
      if (profileReportChart) {
        profileReportChart.destroy();
        profileReportChart = null;
      }
    };
  }, []);

  return <div ref={profileReportChartRef}></div>;
};

export default ProfileReportChart;
